import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './Styles/advertisment.css';

class Advertisment extends React.Component{
    render(){
        return(
            <div class="advertisment">
                <h4>Advertisment</h4>
            </div>
        )
    }
}

export default Advertisment;
